import React, {Component} from 'react';
import { Link } from 'react-router-dom';

import './style.css';

class Inventory extends Component {
    constructor(props) {
        super(props);
        this.state = {
            inventory: false
        }
    }

    render() {
        let inventory =
        this.props.inventory.map(inventory => (
            <p key={inventory}>{inventory.product_name}    -   {inventory.store_name}    -    {inventory.quantity}</p>
        )); 

        return (
            <div>
                <h2>Current Inventory:</h2>
                <h3>Product Name        Store ID        Quantity</h3>
                {inventory}
            </div>
        )
    }
}

export default Inventory
